/*Table structure for table `cart` */

DROP TABLE IF EXISTS `cart`;

CREATE TABLE `cart` (
  `cartid` int(10) NOT NULL AUTO_INCREMENT,
  `totprice` int(10) NOT NULL,
  `cquantity` int(10) NOT NULL,
  `pid` int(10) DEFAULT NULL,
  `id` int(10) DEFAULT NULL,
  PRIMARY KEY (`cartid`),
  KEY `pid` (`pid`),
  KEY `id` (`id`),
  CONSTRAINT `cart_ibfk_1` FOREIGN KEY (`pid`) REFERENCES `product` (`pid`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `cart_ibfk_2` FOREIGN KEY (`id`) REFERENCES `register` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=latin1;

/*Data for the table `cart` */

insert  into `cart`(`cartid`,`totprice`,`cquantity`,`pid`,`id`) values (48,150,1,19,11);

/*Table structure for table `contact` */

DROP TABLE IF EXISTS `contact`;

CREATE TABLE `contact` (
  `cid` int(10) NOT NULL AUTO_INCREMENT,
  `cname` varchar(100) NOT NULL,
  `cemail` varchar(100) NOT NULL,
  `comment` varchar(100) NOT NULL,
  PRIMARY KEY (`cid`)
