/*Table structure for table `demo` */

DROP TABLE IF EXISTS `demo`;

CREATE TABLE `demo` (
  `did` int(10) NOT NULL AUTO_INCREMENT,
  `id` int(10) DEFAULT NULL,
  `mid` int(10) DEFAULT NULL,
  `demodate` date NOT NULL,
  `address` varchar(100) NOT NULL,
  `phone` varchar(10) NOT NULL,
  PRIMARY KEY (`did`),
  KEY `id` (`id`),
  KEY `mid` (`mid`),
  CONSTRAINT `demo_ibfk_1` FOREIGN KEY (`id`) REFERENCES `register` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `demo_ibfk_2` FOREIGN KEY (`mid`) REFERENCES `machinery` (`mid`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=latin1;

