  `reartype` varchar(100) NOT NULL,
  `liftcap` varchar(100) NOT NULL,
  `fuelcap` varchar(100) NOT NULL,
  `image` longblob NOT NULL,
  PRIMARY KEY (`mid`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=latin1;

